★スポーツドクター監修インソール<BR>
            ★疲れにくい歩行をサポート<BR>
            ★こだわりの突起配置＋カットラインでオーダーメイドの付け心地<BR>
            ★ブーツやパンプスなど様々な靴に使用可能<BR>
            <BR>
            ☆足のお悩みや正しい歩行を熟知したスポーツドクター監修(勝野式)<BR>
            ☆足をしっかりサポートして長時間歩いても疲れにくい履き心地を追求しました<BR>
            ☆中足骨と土ふまずパッドが縦・横アーチをしっかり整えて疲れにくく気持ちの良い理想的な歩行をサポートします<BR>
            ☆カットラインにより足に合わせたサイズ調整が可能！突起がしっかりフィットします<BR>
            <BR>
            ★ソール裏の滑り止め設計で靴の中のズレを防止します<BR>
            ★ブーツやパンプスなど様々な靴でご使用頂けます！<BR>
            ★ベージュとブラックの2色展開で靴に入れても目立ちにくい！ <BR>
            </SPAN></FONT></TD></TR></TBODY></TABLE>


